import styled from "styled-components";

export const Container = styled.div`
  margin-left: 200px;
  flex: 1;
  padding: 20px;

  > header {
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin: 0 0 20px;

    h1 {
      color: #0c3d5f;
      font-size: 20px;
    }

    hr {
      display: block;
      height: 1px;
      border-top: 1px solid #cecece;
    }

    div {
      button {
        margin-left: 10px;
      }
    }
  }
`;

export const TaskItem = styled.div`
  color: #0c3d5f;
  background: #fff;
  border-radius: 5px;
  margin: 20px 10px;
  padding: 20px;
  width: 30%;
  box-shadow: 0 2px 10px 0 rgba(0, 0, 0, 0.1);

  p {
    font-size: 15px;
  }
`;

export const ContainerTasks = styled.div`
  display: flex;
  flex-wrap: wrap;
  align-items: center;
  justify-content: flex-start;
`;

export const Teste = styled.div`
  display: flex;
  flex-wrap: wrap;
  align-items: center;
  justify-content: flex-start;
`;

export const Title = styled.p`
  margin-left: 5px;
`;
